Una web puede tener muchos estilos, que deber√°n ser consistentes cuando cambien. Para facilitar su mantenimiento, se han creado herramientas que permiten escribir las reglas de forma m√°s modular o program√°tica. La m√°s usada es Sass que utiliza la sintaxis SCSS (.scss) para extender el lenguaje CSS. Los navegadores solo entienden CSS, por lo que para usar estas extensiones es necesario pre-procesar (o compilar) sus ficheros y convertirlos a CSS antes de desplegar la web [1] . Algunas de las caracter√≠sticas de Sass son similares a otras de CSS: Variables SCSS /* SCSS */
$fuente-principal: Helvetica, sans-serif;
p { font: 100% $fuente-principal; } Variables CSS /* CSS */
html { --fuente-principal: Helvetica, sans-serif; }
p { font: 100% var(--fuente-principal); } Selector de hijos SCSS /* SCSS */
nav { li { display: inline-block; }
} Selector de hijos CSS /* CSS */
nav li { display: inline-block; } M√≥dulos SCSS /* SCSS: hay otro fichero _base.scss */
@use 'base';
/* Aqu√≠ otras reglas SCSS */ M√≥dulos CSS /* CSS: hay otro fichero base.css */
@import 'base.css';
/* Aqu√≠ otras reglas CSS */ Herencia SCSS /* SCSS */
%message-common { border: 1px solid #ccc; padding: 10px; color: #333;
}
.mensaje { @extend %message-common;
}
