}
.exito { border-color: green; }
.error { border-color: red; } Operaciones SCSS /* SCSS */
$ancho-inicial: 30em;
div { width: $ancho-inicial + 2em; } Operaciones CSS /* CSS */
html { --ancho-inicial: 30em; }
div { width: calc(var(--ancho-inicial) + 2em); } Estas otras caracter√≠sticas solo son posibles gracias al pre-procesado : Interpolaci√≥n SCSS $pantallas-peque√±as: 36em;
@media (max-width: #{$pantallas-peque√±as}) { /* reglas para pantallas peque√±as */ p {¬†font-size: 150%; }
} Mixins SCSS @mixin theme($theme: darkgray) { background: $theme; box-shadow: 0 0 1px rgba($theme, .25); color: #fff;
}
.info { @include theme; }
.alerta { @include theme($theme: darkred); }
.exito { @include theme($theme: darkgreen); } Funciones SCSS @function mas-verde($color) { @return $color + rgb(0,50,0);
}
p { background: mas-verde(gray); } Directivas de control $debug: true;
article { color: black; /* Para comprobar el dise√±o resaltando los bordes */ @if ($debug) { border: 1px dotted red; }
} &lt;body&gt;
&lt;p&gt;Este es un ejemplo de SCSS mixin con el que puedes jugar directamente. Puedes probar el resto de caracter√≠sticas de Sass en este Codepen.io. El mixin "ellipsis" crea bloques de texto del ancho y n√∫mero de l√≠neas indicado. Si el contenido ocupa m√°s que el n√∫mero de l√≠neas indicado, el texto se acorta y se muestra una elipsis ("‚Ä¶").&lt;/p&gt;
&lt;/body&gt; @mixin ellipsis($lineas: 1, $ancho: 100%) { width: $ancho; overflow: hidden; text-overflow: ellipsis; display: -webkit-box; line-clamp: $lineas; -webkit-line-clamp: $lineas; -webkit-box-orient: vertical;
} p { @include ellipsis($lineas: 2, $ancho: 20rem); } Esto implica tener un sistema de construcci√≥n del proyecto que automatice la generaci√≥n de los CSS finales.

